INSERT INTO `work_permit_questions` (`id`, `title`, `work_permit_type_id`, `work_permit_confine_type_id`) VALUES
(1, 'ได้ตัดกระแสไฟฟ้า เครื่องจักร อุปกรณ์ไฟฟ้า ติดป้ายเตือนและล็อคเรียบร้อย', 1, NULL),
(2, 'ได้หลีกเลี่ยงการปฏิบัติงานใกล้สารไวไฟ และปิดกั้นไม่ให้ประกายไฟออกจากจุดทำงาน', 1, NULL),
(3, 'ได้ทำความสะอาดบริเวณที่ปฏิบัติงานและจุดใกล้เคียงระยะ 11 เมตรให้ปราศจากสิ่งติดไฟได้', 1, NULL),
(4, 'มีการจัดวัสดุทนไฟเพื่อป้องกันสะเก็ดไฟกระเด็นออกนอกพื้นที่ปฏิบัติงาน', 1, NULL),
(5, 'อุปกรณ์ที่นำมาใช้งานเช่น เครื่องเชื่อมถังแก๊ส ปลั๊กไฟ อยู่ในสภาพที่ปลอดภัย ใช้งานถูกต้อง', 1, NULL),
(6, 'อุปกรณ์ดับเพลิงมีเพียงพอและเหมาะสมต่อการใช้งาน และมีอย่างน้อย 2 ถัง', 1, NULL),
(7, 'บริเวณพื้นที่ปฏิบัติงานที่อากาศถ่ายเทอย่างพอเพียง', 1, NULL),
(8, 'มีการติดตั้งป้ายเตือนสัญลักษณ์เตือนบริเวณพื้ีนที่ทำงานเรียบร้อยแล้ว', 1, NULL),
(9, 'มีอุปกรณ์ป้องกันภัยส่วนบุคคลและอุปกรณ์อยู่ในสภาพที่สมบูรณ์พร้อมใช้งาน', 1, NULL),
